import { useEffect, useRef, useState } from 'react';
import { FaceLandmarker, FilesetResolver, DrawingUtils } from '@mediapipe/tasks-vision';

interface Landmark {
  x: number;
  y: number;
  z?: number;
}

export function useFaceLandmarker() {
